import Myname from './name';
import './expenses.css';
import ExpensesFilter from './EXPFl';
import { useState } from 'react';

function Expenses(props){
    const [prev, newa] = useState('2019')
    const orfun = (sette)=>{
        newa(sette)


    }


    return (
        <div className='expenses'>
            <ExpensesFilter  selected = {prev} orfun ={orfun} />
            <Myname 
            title = {props.mame[0].title}
            amount ={props.mame[0].amount}
            date = {props.mame[0].date}
            ></Myname>
            <Myname 
            title = {props.mame[1].title} 
            amount ={props.mame[1].amount}
            date = {props.mame[1].date}
            ></Myname>
        </div>
    )
}
export default Expenses;
